def debackslash(string):
    mystr = list(string)
    for x in range(0,len(mystr)):
        if(mystr[x] == "\\"):
            mystr[x] = "/"
    catdstring = ""
    for x in range(0,len(mystr)):
        catdstring = catdstring + str(mystr[x])
    return catdstring

