    def setcolors(self,colora,colorb,colorc):
        self.colorA = colora[:]
        self.colorB = colorb[:]
        self.colorC = colorc[:]

    def getcolors(self):
        return [self.colorA,self.colorB,self.colorC]

    def draw_16x16(self,image,coords):
        self.tmpsurface = pygame.Surface([16,16])
        self.tmpsurface.set_colorkey([0,0,0])
        for x in range(0,len(image[0])):
            for y in range(0,len(image)):
                if(image[x][y] == 0):
                    self.tmpsurface.set_at([x + coords[0],y + coords[1]],[0,0,0])
                if(image[x][y] == 1):
                    self.tmpsurface.set_at([x + coords[0],y + coords[1]],self.colorA)
                elif(image[x][y] == 2):
                    self.tmpsurface.set_at([x + coords[0],y + coords[1]],self.colorB)
                elif(image[x][y] == 3):
                    self.tmpsurface.set_at([x + coords[0],y + coords[1]],self.colorC)
        return self.tmpsurface

    def checkcollision(self,collidecoords,gdcoords,gravity):
        #there's a few different types of collision: 'ground' stuff you can stand on, or 'slamleft', 'slamright', 'slamup', and 'slamdown'.
        #then there's triangles / spikes.  they all return 'triangle' (you're dead)
        #Bouncepads and Bounceballs work similarly.  there's powers 1-4, and 5-8 are upsidedown variants.  They all return 'bounceballP(power)' or 'bouncepadP(power)'
        self.collision = []
        self.gravity = gravity
        for x in range(0,len(collidecoords)):
            if(collidecoords[x][5] == 'ground'):  #this is for block collision ONLY.
                if(collidecoords[x][4] == 1):
                    #pygame.draw.rect(screen,[255,255,255],[collidecoords[x][0],collidecoords[x][1],10,10],1)
                    #inside a collision list, we get [x,y,x2,y2,Collision Type:(1 = Ground,2 = Death), in GDcoords, we have just [x,y,x2,y2] though.
                    if(collidecoords[x][0] < gdcoords[2]):  #is the right side of GD greater than left side of block?
                        if(collidecoords[x][2] > gdcoords[0]): #is the left side of GD smaller than right side of block?
                            if(collidecoords[x][3] > gdcoords[1]): #is the top of GD above the bottom of block?
                                if(collidecoords[x][1] < gdcoords[3]): # is the top of block above bottom of GD?
                                    #COLLISION OCCURRED!!!
                                    self.collision.append('ground')
                                    #now we check, have we SLAMMED a block, on the left?
                                    if(collidecoords[x][0] < gdcoords[2] and collidecoords[x][0] + 3 > gdcoords[2]): #is the right side of GD embedded within the first 3 pixels of a block?
                                        if(collidecoords[x][1] + 3 < gdcoords[3] and collidecoords[x][3] - 3 > gdcoords[1]):
                                            self.collision.append('slamleft')
                                    #have we slammed the bottom of a block?
                                    if(collidecoords[x][0] < gdcoords[2] and collidecoords[x][2] > gdcoords[0]):  #is our x parallel with the block?
                                        if(collidecoords[x][3] > gdcoords[1] and collidecoords[x][3] - 2 < gdcoords[1]):
                                            self.collision.append('slamdown')
                                    #have we slammed the top of a block?
                                    if(collidecoords[x][0] < gdcoords[2] and collidecoords[x][2] > gdcoords[0]):  #is our x parallel with the block?
                                        if(collidecoords[x][1] + 2 > gdcoords[3] and collidecoords[x][1] < gdcoords[3]):
                                            self.collision.append('slamup')
                                    #have we slammed the right side of a block? (impossible unless direction is reversed)
                                    if(collidecoords[x][2] - 3 < gdcoords[2] and collidecoords[x][2] > gdcoords[0]): #is our x somewhere in the rightish area of the block?
                                        if(collidecoords[x][1] + 3 < gdcoords[3] and collidecoords[x][3] - 3 > gdcoords[1]):
                                            self.collision.append('slamright')
            elif(collidecoords[x][5] == 'triangle'):
                if(collidecoords[x][4] == 1):
                    #triangle collision!
                    self.trianglecoords = []
                    self.trianglecoords.append(collidecoords[x][0] + 2)
                    self.trianglecoords.append(collidecoords[x][1] + 1)
                    self.trianglecoords.append(collidecoords[x][2] - 2)
                    self.trianglecoords.append(collidecoords[x][3] - 1)
                    if(self.trianglecoords[0] < gdcoords[2]):  #is the right side of GD greater than left side of block?
                        if(self.trianglecoords[2] > gdcoords[0]): #is the left side of GD smaller than right side of block?
                            if(self.trianglecoords[3] > gdcoords[1]): #is the top of GD above the bottom of block?
                                if(self.trianglecoords[1] < gdcoords[3]): # is the top of block above bottom of GD?
                                    #COLLISION OCCURRED!!!
                                    self.collision.append('triangle')
            elif(collidecoords[x][5] == 'booster'):
                if(collidecoords[x][0] < gdcoords[2]):  #is the right side of GD greater than left side of booster?
                        if(collidecoords[x][2] > gdcoords[0]): #is the left side of GD smaller than right side of booster?
                            if(collidecoords[x][3] > gdcoords[1]): #is the top of GD above the bottom of booster?
                                if(collidecoords[x][1] < gdcoords[3]): # is the top of booster above bottom of GD?
                                    #collision with bouncepad has occured.  what kind happened???
                                    if(collidecoords[x][4] == 1 or collidecoords[x][4] == 5):
                                        #jump bouncepad hit!
                                        self.collision.append('bouncepadP1')
                                        self.move([0,-1],gravity)
                                    elif(collidecoords[x][4] == 2 or collidecoords[x][4] == 6):
                                        #50/50 jump happened!
                                        self.collision.append('bouncepadP2')
                                        self.move([0,-1],gravity)
                                    elif(collidecoords[x][4] == 3 or collidecoords[x][4] == 7):
                                        #superjump happened!
                                        self.collision.append('bouncepadP3')
                                        self.move([0,-1],gravity)
                                    elif(collidecoords[x][4] == 4 or collidecoords[x][4] == 8):
                                        #GRAVITYCHANGE + superjump!!!!
                                        self.gravity = gravity * -1
                                        self.collision.append('bouncepadP4')
            elif(collidecoords[x][5] == 'bounceball'):
                if(collidecoords[x][0] < gdcoords[2]):  #is the right side of GD greater than left side of bounceball?
                        if(collidecoords[x][2] > gdcoords[0]): #is the left side of GD smaller than right side of bounceball?
                            if(collidecoords[x][3] > gdcoords[1]): #is the top of GD above the bottom of bounceball?
                                if(collidecoords[x][1] < gdcoords[3]): # is the top of bounceball above bottom of GD?
                                    #collision!
                                    if(collidecoords[x][4] == 1):
                                        self.collision.append('bounceballP1')
                                    elif(collidecoords[x][4] == 2):
                                        self.collision.append('bounceballP2')
                                    elif(collidecoords[x][4] == 3):
                                        self.collision.append('bounceballP3')
                                    elif(collidecoords[x][4] == 4):
                                        self.collision.append('bounceballP4')
            elif(collidecoords[x][5] == 'portal'):
                if(collidecoords[x][0] < gdcoords[2]):  #is the right side of GD greater than left side of portal?
                        if(collidecoords[x][2] > gdcoords[0]): #is the left side of GD smaller than right side of portal?
                            if(collidecoords[x][3] > gdcoords[1] - 5): #is the top of GD above the bottom of portal?
                                if(collidecoords[x][1] < gdcoords[3] + 5): # is the top of portal above bottom of GD?
                                    #collision!
                                    self.collision.append('portal#' + str(collidecoords[x][4]))
        try:
            del self.trianglecoords
        except AttributeError:
            pass
        return self.collision, self.gravity
            

