    def draw_tile(self,tile,coords):
        for z in range(0,len(tile)):
            if(1 in tile[z] and not 0 in tile[z] and not 2 in tile[z] and not 3 in tile[z]):
                pygame.draw.rect(screen,self.colorA,[coords[0],coords[1],10,10],0)
            else:
                for x in range(0,len(tile[0])):
                    for y in range(0,len(tile)):
                        if(tile[y][x] != 0):
                            if(tile[y][x] == 1):
                                pygame.draw.line(screen,self.colorA,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                            elif(tile[y][x] == 2):
                                pygame.draw.line(screen,self.colorB,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                            elif(tile[y][x] == 3):
                                pygame.draw.line(screen,self.colorC,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                break

    def setcolors(self,colorA,colorB,colorC):
        self.colorA = colorA[:]
        self.colorB = colorB[:]
        self.colorC = colorC[:]

    def getcolors(self):
        return [self.colorA,self.colorB,self.colorC]

    def draw_arena(self,currentmap,coords,speccoords):
        if(self.direction == 'right'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[x * 10 + speccoords[0],y * 10 + speccoords[1]])
        elif(self.direction == 'left'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    newx = self.screen_w - (x + 1)
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[newx * 10 + speccoords[0],newy * 10 + speccoords[1]])

    def return_collision(self,currentmap,coords,speccoords):
        self.collidecoords = []
        if(self.direction == 'right'):
            for x in range(0,21):
                for y in range(0,12):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        # Type 3 Collision = bounce, Type 2 collision = Death!, Type 1 collision = Ground                                                    v - that number is the collision type
                        if(currentmap[coords[1] + y][coords[0] + x] == 1):
                            self.collidecoords.append([x * 10 + speccoords[0],y * 10 + speccoords[1],x * 10 + speccoords[0] + 10,y * 10 + speccoords[1] + 10,1,'ground'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                            self.collidecoords.append([x * 10 + speccoords[0],y * 10 + speccoords[1],x * 10 + speccoords[0] + 10,y * 10 + speccoords[1] + 5,1,'ground'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                            self.collidecoords.append([x * 10 + speccoords[0],y * 10 + speccoords[1] + 5,x * 10 + speccoords[0] + 10,y * 10 + speccoords[1] + 10,1,'ground'])
        elif(self.direction == 'left'):
            for x in range(0,21):
                for y in range(0,12):
                    newx = 20 - x
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        # Type 3 Collision = bounce, Type 2 collision = Death!, Type 1 collision = Ground
                        if(currentmap[coords[1] + y][coords[0] + x] == 1):
                            self.collidecoords.append([newx * 10 + speccoords[0],newy * 10 + speccoords[1],newx * 10 + speccoords[0] + 10,newy * 10 + speccoords[1] + 10,1,'ground'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                            self.collidecoords.append([newx * 10 + speccoords[0],newy * 10 + speccoords[1],newx * 10 + speccoords[0] + 10,newy * 10 + speccoords[1] + 5,1,'ground'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                            self.collidecoords.append([newx * 10 + speccoords[0],newy * 10 + speccoords[1] + 5,newx * 10 + speccoords[0] + 10,newy * 10 + speccoords[1] + 10,1,'ground'])
        return self.collidecoords



