    def draw_tile(self,tile,coords):
            for x in range(0,len(tile[0])):
                for y in range(0,len(tile)):
                    if(tile[y][x] != 0):
                        if(tile[y][x] == 1):
                            pygame.draw.line(screen,self.colorA,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                        elif(tile[y][x] == 2):
                            pygame.draw.line(screen,self.colorB,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                        elif(tile[y][x] == 3):
                            pygame.draw.line(screen,self.colorC,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)
                        elif(tile[y][x] == 4):
                            pygame.draw.line(screen,self.colorD,[x + coords[0],y + coords[1]],[x + coords[0],y + coords[1]],1)

    def setcolors(self,colorA,colorB,colorC,colorD):
        self.colorA = colorA[:]
        self.colorB = colorB[:]
        self.colorC = colorC[:]
        self.colorD = colorD[:]

    def getcolors(self):
        return [self.colorA,self.colorB,self.colorC]

    def draw_arena(self,currentmap,coords,speccoords,fgeffects,currentframe,time,gamespeed):
        if(self.direction == 'right'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[x * 10 + speccoords[0],y * 10 + speccoords[1]])
                        #Code for pixel effects:  [[beginning size,ending size],[[beginning posX,beginningposY],[ending posX,endingposY]],[beginning color,ending color],[Duration (in frames) of effect,starting frame]]
                        if(currentmap[coords[1] + y][coords[0] + x] <= 4 and currentframe % 4 == 0):
                            if(currentmap[coords[1] + y][coords[0] + x] == 1):
                                effectcolor = self.colorA[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                                effectcolor = self.colorB[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                                effectcolor = self.colorC[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 4):
                                effectcolor = self.colorD[:]
                            if(self.direction == 'right'):
                                for z in range(0,1):
                                    randomizerx = random.randint(-5,15)
                                    randomizery = random.randint(-5,15)
                                    fgeffects.addeffect('pixel',[[4,1],[[x * 10 + speccoords[0] + 5,y * 10 + speccoords[1] + 5],[x * 10 + speccoords[0] - time + randomizerx,y * 10 + speccoords[1] + randomizery]],[effectcolor,effectcolor],[int(time / gamespeed),currentframe + 1]])
                                if(currentframe % time - 8 == 0 and time >= 8):
                                    fgeffects.addeffect('circle',[[1,10],[[x * 10 + speccoords[0] + 2,y * 10 + speccoords[1] + 5],[x * 10 + speccoords[0] + 2 - int(time / 2) * gamespeed,y * 10 + speccoords[1] + 5]],[effectcolor,effectcolor],[int(time / 2),currentframe + 1]])
                                    fgeffects.addeffect('circle',[[10,1],[[x * 10 + speccoords[0] + 2 - int(time / 2) * gamespeed,y * 10 + speccoords[1] + 5],[x * 10 + speccoords[0] + 2 - (time * gamespeed),y * 10 + speccoords[1] + 5]],[effectcolor,effectcolor],[int(time / 2),currentframe + 1 + time / 2]])
        if(self.direction == 'left'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    newx = self.screen_w - (x + 1)
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[newx * 10 + speccoords[0],newy * 10 + speccoords[1]])
                        #Code for pixel effects:  [[beginning size,ending size],[[beginning posX,beginningposY],[ending posX,endingposY]],[beginning color,ending color],[Duration (in frames) of effect,starting frame]]
                        if(currentmap[coords[1] + y][coords[0] + x] <= 4 and currentframe % 4 == 0):
                            if(currentmap[coords[1] + y][coords[0] + x] == 1):
                                effectcolor = self.colorA[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                                effectcolor = self.colorB[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                                effectcolor = self.colorC[:]
                            elif(currentmap[coords[1] + y][coords[0] + x] == 4):
                                effectcolor = self.colorD[:]
                            for z in range(0,1):
                                randomizerx = random.randint(-5,15)
                                randomizery = random.randint(-5,15)
                                fgeffects.addeffect('pixel',[[4,1],[[newx * 10 + speccoords[0] + 5,newy * 10 + speccoords[1] + 5],[newx * 10 + speccoords[0] + time * gamespeed + randomizerx,newy * 10 + speccoords[1] + randomizery]],[effectcolor,effectcolor],[time,currentframe + 1]])
                            if(currentframe % time - 8 == 0 and time >= 8):
                                fgeffects.addeffect('circle',[[1,10],[[newx * 10 + 7 + speccoords[0],newy * 10 + 5 + speccoords[1]],[newx * 10 + 7 + speccoords[0] + (time / 2) * gamespeed,newy * 10 + 5 + speccoords[1]]],[effectcolor,effectcolor],[time / 2,currentframe + 1]])
                                fgeffects.addeffect('circle',[[10,1],[[newx * 10 + 8 + speccoords[0] + time / 2,newy * 10 + 5 + speccoords[1]],[newx * 10 + speccoords[0] + 8 + (time * gamespeed),newy * 10 + 5 + speccoords[1]]],[effectcolor,[0,0,0]],[time / 2,currentframe + 1 + time / 2]])

    def lackluster_draw_arena(self,currentmap,coords,speccoords): #more basic version of draw_arena(). used in class LevelEditor()
        if(self.direction == 'right'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[x * 10 + speccoords[0],y * 10 + speccoords[1]])
        if(self.direction == 'left'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    newx = self.screen_w - (x + 1)
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[newx * 10 + speccoords[0],newy * 10 + speccoords[1]])

    def return_collision(self,currentmap,coords,speccoords):
        self.collidecoords = []
        if(self.direction == 'right'):
            for x in range(0,20):
                for y in range(0,12):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        if(currentmap[coords[1] + y][coords[0] + x] == 1):
                            self.collidecoords.append([x * 10 + speccoords[0] - 2,y * 10 + speccoords[1] - 2,x * 10 + speccoords[0] + 12,y * 10 + speccoords[1] + 12,1,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                            self.collidecoords.append([x * 10 + speccoords[0] - 2,y * 10 + speccoords[1] - 2,x * 10 + speccoords[0] + 12,y * 10 + speccoords[1] + 12,2,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                            self.collidecoords.append([x * 10 + speccoords[0] - 2,y * 10 + speccoords[1] - 2,x * 10 + speccoords[0] + 12,y * 10 + speccoords[1] + 12,3,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 4):
                            self.collidecoords.append([x * 10 + speccoords[0] - 2,y * 10 + speccoords[1] - 2,x * 10 + speccoords[0] + 12,y * 10 + speccoords[1] + 12,4,'bounceball'])
        elif(self.direction == 'left'):
            for x in range(0,20):
                for y in range(0,12):
                    newx = 20 - x
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        if(currentmap[coords[1] + y][coords[0] + x] == 1):
                            self.collidecoords.append([newx * 10 + speccoords[0] - 2,newy * 10 + speccoords[1] - 2,newx * 10 + speccoords[0] + 12,newy * 10 + speccoords[1] + 12,1,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 2):
                            self.collidecoords.append([newx * 10 + speccoords[0] - 2,newy * 10 + speccoords[1] - 2,newx * 10 + speccoords[0] + 12,newy * 10 + speccoords[1] + 12,2,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 3):
                            self.collidecoords.append([newx * 10 + speccoords[0] - 2,newy * 10 + speccoords[1] - 2,newx * 10 + speccoords[0] + 12,newy * 10 + speccoords[1] + 12,3,'bounceball'])
                        elif(currentmap[coords[1] + y][coords[0] + x] == 4):
                            self.collidecoords.append([newx * 10 + speccoords[0] - 2,newy * 10 + speccoords[1] - 2,newx * 10 + speccoords[0] + 12,newy * 10 + speccoords[1] + 12,4,'bounceball'])

        return self.collidecoords




