    def draw_tile(self,tile,coords):
        for x in range(0,len(tile[0])):
            for y in range(0,len(tile)):
                if(tile[y][x] != 0):
                    if(tile[y][x] == 1):
                        screen.set_at([x + coords[0],y + coords[1]],self.colorA)
                    elif(tile[y][x] == 2):
                        screen.set_at([x + coords[0],y + coords[1]],self.colorB)
                    elif(tile[y][x] == 3):
                        screen.set_at([x + coords[0],y + coords[1]],self.colorC)

    def setcolors(self,colorA,colorB,colorC):
        self.colorA = colorA[:]
        self.colorB = colorB[:]
        self.colorC = colorC[:]

    def getcolors(self):
        return [self.colorA,self.colorB,self.colorC]

    def draw_arena(self,currentmap,coords,speccoords): #incresing the Y on coords moves the map up, while decreasing the Y on speccoords moves the map up...
        if(self.direction == 'right'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[x * 10 + speccoords[0],y * 10 + speccoords[1]])
        elif(self.direction == 'left'):
            for x in range(0,self.screen_w):
                for y in range(0,self.screen_h):
                    newx = self.screen_w - (x + 1)
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        self.draw_tile(self.tiles[currentmap[coords[1] + y][coords[0] + x] - 1],[newx * 10 + speccoords[0],newy * 10 + speccoords[1]])

    def return_collision(self,currentmap,coords,speccoords):
        self.collidecoords = []
        if(self.direction == 'right'):
            for x in range(0,20):
                for y in range(0,12):
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        # Type 1 Triangle collision = standard triangle death hitbox
                        if(currentmap[coords[1] + y][coords[0] + x] != 0 and currentmap[coords[1] + y][coords[0] + x] < 5):
                            self.collidecoords.append([x * 10 + speccoords[0] + 2,y * 10 + speccoords[1] + 2,x * 10 + speccoords[0] + 8,y * 10 + speccoords[1] + 8,1,'triangle'])
                        elif(currentmap[coords[1] + y][coords[0] + x] >= 5 and currentmap[coords[1] + y][coords[0] + x] <= 8):
                            self.collidecoords.append([x * 10 + speccoords[0] + 4,y * 10 + speccoords[1] + 4,x * 10 + speccoords[0] + 6,y * 10 + speccoords[1] + 6,1,'triangle'])
        elif(self.direction == 'left'):
            for x in range(0,20):
                for y in range(0,12):
                    newx = 20 - x
                    newy = y
                    if(currentmap[coords[1] + y][coords[0] + x] != 0):
                        # Type 1 Triangle collision = standard triangle death hitbox
                        if(currentmap[coords[1] + y][coords[0] + x] != 0 and currentmap[coords[1] + y][coords[0] + x] < 5):
                            self.collidecoords.append([newx * 10 + speccoords[0] + 2,newy * 10 + speccoords[1] + 2,newx * 10 + speccoords[0] + 8,newy * 10 + speccoords[1] + 8,1,'triangle'])
                        elif(currentmap[coords[1] + y][coords[0] + x] >= 5 and currentmap[coords[1] + y][coords[0] + x] <= 8):
                            self.collidecoords.append([newx * 10 + speccoords[0] + 4,newy * 10 + speccoords[1] + 4,newx * 10 + speccoords[0] + 6,newy * 10 + speccoords[1] + 6,1,'triangle'])
        return self.collidecoords

