class BGEffects():
    def __init__(self):
        self.effectspos = []
        self.effectscolor = [40,40,40]
        self.onoff = True

    def moveeffects(self,direction):
        if(self.onoff == False):
            return
        if(direction == 'right'):
            for x in range(0,len(self.effectspos)):
                if(self.effectspos[x][0] < 210 + self.effectspos[x][3]):
                    self.effectspos[x][0] = self.effectspos[x][0] + self.effectspos[x][4]
                else:
                    self.effectspos[x][0] = 0 - self.effectspos[x][3]
        elif(direction == 'left'):
            for x in range(0,len(self.effectspos)):
                if(self.effectspos[x][0] > -10 - self.effectspos[x][3]):
                    self.effectspos[x][0] = self.effectspos[x][0] - self.effectspos[x][4]
                else:
                    self.effectspos[x][0] = 210 + self.effectspos[x][3]
        elif(direction == 'up'):
            for x in range(0,len(self.effectspos)):
                if(self.effectspos[x][1] > 0 - self.effectspos[x][3]):
                    self.effectspos[x][1] = self.effectspos[x][1] - self.effectspos[x][4]
                else:
                    self.effectspos[x][1] = 130 + self.effectspos[x][3]
        elif(direction == 'down'):
            for x in range(0,len(self.effectspos)):
                if(self.effectspos[x][1] < 130 + self.effectspos[x][3]):
                    self.effectspos[x][1] = self.effectspos[x][1] + self.effectspos[x][4]
                else:
                    self.effectspos[x][1] = 0 - self.effectspos[x][3]

    def createeffect(self,coords,shape,size,speed):
        if(self.onoff == True):
            self.effectspos.append([coords[0],coords[1],shape,size,speed])

    def setcolor(self,color):
        self.effectscolor = color[:]

    def getcolor(self):
        return self.effectscolor

    def draweffects(self):
        if(self.onoff == False):
            return
        for x in range(0,len(self.effectspos)):
            if(self.effectspos[x][2] == 'circle'):
                pygame.draw.circle(screen,self.effectscolor,[self.effectspos[x][0],self.effectspos[x][1]],self.effectspos[x][3],5)
            elif(self.effectspos[x][2] == 'square'):
                pygame.draw.rect(screen,self.effectscolor,[self.effectspos[x][0],self.effectspos[x][1],self.effectspos[x][3],self.effectspos[x][3]],5)



class FGEffects():
    def __init__(self):
        self.pixeleffects = []
        #Code for pixel effects:  [[beginning size,ending size],[[beginning posX,beginningposY],[ending posX,endingposY]],[beginning color,ending color],[Duration (in frames) of effect,starting frame]]
        #Code for circle effects:  [[beginning size,ending size],[beginning pos,ending pos]],[beginning color,ending color],[Duration (in frames) of effect,starting frame]]
        self.circleeffects = []
        self.onoff = True

    def cleareffects(self):
        self.pixeleffects = []
        self.circleeffects = []

    def addeffect(self,EffectType,specs):
        if(self.onoff == True): #only do something if we're actually gonna be using it
            if(EffectType == 'pixel'):
               self.pixeleffects.append(specs[:])
            elif(EffectType == 'circle'):
               self.circleeffects.append(specs[:])

    def draweffects(self,currentframe):
        if(self.onoff == False):
            return
        #because of the way I delete old effects, I need this variable
        self.subtractone = 0
        for x in range(0,len(self.circleeffects)):
            self.selectedeffect = self.circleeffects[x - self.subtractone]

            #locate beginning frame and ending frame
            self.end = self.selectedeffect[3][1] + self.selectedeffect[3][0]
            self.beginning = self.selectedeffect[3][1]
            #how many frames are we into this effect?
            self.framesleft = currentframe - self.selectedeffect[3][1]
            self.effectprogress = self.selectedeffect[3][0] - self.framesleft

            if(currentframe >= self.end):
                #are we dealing with a "stale" (ended) effect?
                #if so, delete it, and increment the subtractone...
                del(self.circleeffects[x - self.subtractone])
                #variable to keep track that the list lost a length (IMPORTANT)
                self.subtractone += 1
            else:
                if(self.framesleft > 0):
                    self.redchange = (self.selectedeffect[2][1][0] - self.selectedeffect[2][0][0]) / float(self.selectedeffect[3][0])
                    self.greenchange = (self.selectedeffect[2][1][1] - self.selectedeffect[2][0][1]) / float(self.selectedeffect[3][0])
                    self.bluechange = (self.selectedeffect[2][1][2] - self.selectedeffect[2][0][2]) / float(self.selectedeffect[3][0])
                    self.newcolor = [self.redchange * self.framesleft + self.selectedeffect[2][0][0],self.greenchange * self.framesleft + self.selectedeffect[2][0][1],self.bluechange * self.framesleft + self.selectedeffect[2][0][2]]
                    self.xmove = (self.selectedeffect[1][1][0] - self.selectedeffect[1][0][0]) / float(self.selectedeffect[3][0]) #how much to move effect in a single frame on X axis
                    self.ymove = (self.selectedeffect[1][1][1] - self.selectedeffect[1][0][1]) / float(self.selectedeffect[3][0]) #how much to move effect in a single frame on Y axis
                    self.sizemove = (self.selectedeffect[0][1] - self.selectedeffect[0][0]) / float(self.selectedeffect[3][0]) #how much to grow effect in a single frame
                    pygame.draw.circle(screen,self.newcolor,[int(self.xmove * self.framesleft + self.selectedeffect[1][0][0]),int(self.ymove * self.framesleft + self.selectedeffect[1][0][1])],int(self.selectedeffect[0][0] + self.sizemove * self.framesleft),2)
        self.subtractone = 0
        for x in range(0,len(self.pixeleffects)):
            self.selectedeffect = self.pixeleffects[x - self.subtractone]

            #locate beginning frame and ending frame
            self.end = self.selectedeffect[3][1] + self.selectedeffect[3][0]
            self.beginning = self.selectedeffect[3][1]
            #how many frames are we into this effect?
            self.framesleft = currentframe - self.selectedeffect[3][1]
            self.effectprogress = self.selectedeffect[3][0] - self.framesleft

            if(currentframe >= self.end):
                #are we dealing with a "stale" (ended) effect?
                #if so, delete it, and increment the subtractone...
                del(self.pixeleffects[x - self.subtractone])
                #variable to keep track that the list lost a length (IMPORTANT)
                self.subtractone += 1
            else:
                if(self.framesleft > 0):
                    self.redchange = (self.selectedeffect[2][1][0] - self.selectedeffect[2][0][0]) / float(self.selectedeffect[3][0])
                    self.greenchange = (self.selectedeffect[2][1][1] - self.selectedeffect[2][0][1]) / float(self.selectedeffect[3][0])
                    self.bluechange = (self.selectedeffect[2][1][2] - self.selectedeffect[2][0][2]) / float(self.selectedeffect[3][0])
                    self.newcolor = [self.redchange * self.framesleft + self.selectedeffect[2][0][0],self.greenchange * self.framesleft + self.selectedeffect[2][0][1],self.bluechange * self.framesleft + self.selectedeffect[2][0][2]]
                    self.xmove = (self.selectedeffect[1][1][0] - self.selectedeffect[1][0][0]) / float(self.selectedeffect[3][0]) #how much to move effect in a single frame on X axis
                    self.ymove = (self.selectedeffect[1][1][1] - self.selectedeffect[1][0][1]) / float(self.selectedeffect[3][0]) #how much to move effect in a single frame on Y axis
                    self.sizemove = (self.selectedeffect[0][1] - self.selectedeffect[0][0]) / float(self.selectedeffect[3][0]) #how much to grow effect in a single frame
                    pygame.draw.rect(screen,self.newcolor,[int(self.xmove * self.framesleft + self.selectedeffect[1][0][0]),int(self.ymove * self.framesleft + self.selectedeffect[1][0][1]),int(self.selectedeffect[0][0] + self.sizemove * self.framesleft),int(self.selectedeffect[0][0] + self.sizemove * self.framesleft)],2)

class MenuEngine():
    def __init__(self,images,placement):
        self.images = images[:]
        self.buttons = []
        self.buttonplacement = placement[:]
        for x in range(0,len(self.images)):
            self.buttons.append([self.buttonplacement[x][0],self.buttonplacement[x][1],self.images[x].get_width() + self.buttonplacement[x][0],self.images[x].get_height() + self.buttonplacement[x][1]])

    def getcollision(self,cursorpos):
        collision = []
        for x in range(0,len(self.buttons)): #check all buttons in the self.buttons list.
            if(cursorpos[0] > self.buttons[x][0]):
                if(cursorpos[0] < self.buttons[x][2]):
                    if(cursorpos[1] > self.buttons[x][1]):
                        if(cursorpos[1] < self.buttons[x][3]):
                            collision.append(x) #append the button's number to the collision list IF it did indeed collide with the mousepointer/cursor
                            return collision
        return collision

    def drawimages(self,images):
        for x in range(0,len(self.images)):
            screen.blit(images[x],[self.buttons[x][0],self.buttons[x][1]])

