    def create_arena(self): #creates a 20x20 arena grid
        tmparenaP = [] #temporary arena Piece
        for x in range(0,20):
            tmparenaP.append(0)
        tmparena = []
        for x in range(0,50):
            tmparena.append(tmparenaP[:])
        return tmparena[:]

    def resize_arena(self,arena,coords): #checks when the arena is too small and we're gonna get a IndexError. Resizes it from there. #remember, 5*18 arena size!!!
        while True:
            tmp = 0
            if(coords[0] + 18 > len(arena[0])):
                for x in range(0,len(arena)):
                    arena[x].append(0)
                tmp = 1
            if(coords[1] + 15 > len(arena)):
                tmpline = []
                for x in range(0,len(arena[0])):
                    tmpline.append(0)
                arena.append(tmpline[:])
                tmp = 1
            if(tmp == 0):
                break
        return arena[:]

    def arena_check(self, arena): #checks arena consistency and tries to repair if possible
        #repair Y axis check
        y = 0
        while (y < len(arena)):
            try:
                eval("arena[y]")
            except IndexError:
                print("Y Len() desync occurred. Attempting to repair...")
                arenarow = []
                for buildarena in range(0,len(arena[0])): #build a single row of arena
                    arenarow.append(0)
                for repair in range(0,len(arena) - y): #append our blank arena row to fill the space needed
                    arena.append(arenarow)
            y += 1
        #check all X rows, and fix them if possible (level length defined relative to Row 0, be warned)
        for x in range(0,y):
            b = 0
            while True:
                try:
                    eval("arena[x][b]")
                except IndexError:
                    if(b + 1 < len(arena[0])):
                        print("Inconsistencies found on row Y: " + str(x) + ", position " + str(b) + ", " + str(len(arena[0]) - (b + 1)) + " short?")
                        for append in range(0,len(arena[0]) - (b + 1)):
                            arena[x].append(0)
                    break
                b += 1
        return arena #return the repaired arena list

    def draw_tile(self,size,tile,colors): #draws a tile of any size and scales it to 10x10
        tmpsurface = pygame.Surface([10,10])
        scalex = 10.0 / size[0]
        scaley = 10.0 / size[1]
        for x in range(0,size[0]):
            for y in range(0,size[1]):
                xcor = int(scalex * x)
                ycor = int(scaley * y)
                tmpsurface.set_at([xcor,ycor],colors[tile[y][x]])
        return tmpsurface

    def akey(self,keynum):
        for x in range(0,len(self.keys)):
            if(keynum == self.keys[x][0]):
                return self.keys[x][1]
        return "" #if we don't have a keymap for this keypress, return nothing.

    def ListToStr(self,milist):
        tmpstr = ""
        for x in range(0,len(milist)):
            tmpstr = tmpstr + str(milist[x])
        return tmpstr

    def insertrow(self,arena):
        tmplist = []
        for x in range(0,len(arena[0])):
            tmplist.append(0)
        arena.insert(0,tmplist)
        return arena

